"use strict";console.log("js is properly set");document.querySelectorAll(".hover-box").forEach(function(e){e.addEventListener("mouseover",function(e,o){if(document.querySelectorAll(".hoverBox").style){document.querySelectorAll(".hoverBox").forEach(function(e){e.style.display="none"})}var l=figureOutWhichBox(e.fromElement.classList);console.log("box class is ",l);addHoverBox(l)})});document.querySelectorAll(".hoverBox").forEach(function(e){e.addEventListener("mouseleave",function(e){console.log("mousing out now");e.fromElement.style.display="none"})});function addHoverBox(e){if(e){console.log("it was moused over ",e);var o=document.querySelector("."+e);console.log(o);if(o.style.display==="none"){o.style.display="block"}else{o.style.display="none"}}}function figureOutWhichBox(e){var o="";e.forEach(function(e,l){if(e==="servicesNav"){console.log("Services Bar should show");o="serviceBox"}else if(e==="clientsNav"){console.log("Clients Bar should show");o="clientsBox"}});return o}console.log("mobile header code loaded");document.querySelector(".hamburger").addEventListener("click",function(){console.log("yo!");document.querySelector(".mobile-overlay").style.display="block";document.querySelector(".col-full").style.display="none"});document.querySelector(".closebtn").addEventListener("click",function(){document.querySelector(".mobile-overlay").style.display="none";document.querySelector(".col-full").style.display="block"});